import React from "react";

export default function Phonetics(props) {
    if (props.phonetics) {
        return(
            <div className="Phonetics">
                {props.phonetics.map((phonetic, index) => {
                    <div key={index}>
                        <a href={phonetic.audio} target="_blank" rel="noreferrer">Listen</a>
                        <br />
                        {phonetic.text}
                    </div>
                })}
            </div>
        );
    } else {
        return null;
    }
}
